      <h1 className="text-center text-h3-sm lg:text-h3-lg">
        we reply <br /> so you can touch grass
      </h1>
      <button className="bg-black w-48 text-white h-10 mt-8">ok</button>
      <img
        src={ReplyGuy}
        alt="reply guy dude"
        className="fixed bottom-0 h-[30%] lg:h-100"
      />
    </main>
  );
};

export default Home;
